import React from 'react';
import { BellOutlined } from '@ant-design/icons';
import { Badge } from 'antd';
import './styles.css';

export default function NoticeIcon() {
    return (
        <span className="noticeButton">
            <Badge
                title='Notifi'
                count={4}
                style={{
                    boxShadow: 'none',
                    fontSize: '10px'
                }}
            >
                <BellOutlined className="icon" />
            </Badge>
        </span>
    )
};
